import React from "react";
import './navbar.css';
import { Link } from "react-scroll";

const Navbar = () => {
return(
    <nav className="navbar">
        <img src="./LogoU.png" alt="logo" className="logo" /> {/* For logo  */}
        <div className="desktopmenu"> {/* For Navbar menus */}
        <Link className="desktopmenulists">Home</Link>
        <Link className="desktopmenulists">Profile</Link>
        <Link className="desktopmenulists">Contact Me</Link>

        </div>
        <button className="desktopmenubtn">
            <img src="./contact.png" alt="contact" className="desktopmenubtnx" /> </button>
    </nav>

)};

export default Navbar;
